sys_variable_value.value:
(function execute(inputs, outputs) {


	var ritm = new GlideRecord('sc_req_item');
	ritm.get(inputs.ritm);

	var choice = '' + ritm.variables.props;

  	var x = new GlideRecord('x_snc_dp1_demo_dp1_proposals');
  	x.get(choice);

  	// Troubleshooting
  	if (gs.getProperty('x_snc_dp1_demo.dp1debug') == "true") {
	    var y = JSON.stringify(x);
  		gs.info('DP1Debug - (8) Fetch Proposal: ' + choice + '\n' + x.dp1_response + '\n' + x.proposal_assets);
    }

    outputs.choice_record = x;	

})(inputs, outputs);

